'use strict';
class InstrumentDescriptorUpdater {
    static processUpdate(updInstrument, instrumentDescriptor) {
        let instrumentDescriptorBuilder;
        instrumentDescriptorBuilder = instrumentDescriptor;
        if (updInstrument.isSubscriptionStatusChanged()) {
            instrumentDescriptorBuilder.setSubscriptionStatus(updInstrument.getInstrument().getSubscriptionStatus());
        }
    }
}
module.exports = InstrumentDescriptorUpdater
